> indent the visually selected lines once 3> indent the visually selected lines three times < unindent the visually selected lines once = auto indent code Consider the following unindented code: for(i=1; i<5; i++)
{
for(j=i; j<10; j++)
{
statements
}
statements
} Here's the result after applying vip= (you can also use =ip if you prefer Normal mode). for(i=1; i<5; i++)
{ for(j=i; j<10; j++) { statements } statements
} info Indentation depends on the shiftwidth setting. See :h shift-left-right , :h = and :h 'shiftwidth' for more details.

