Suppose you forgot to add curly braces for single statement control structures in a Perl program: # syntax error
if($word eq reverse $word) print "$word is a palindrome\n"; # corrected code
if($word eq reverse $word)
{ print "$word is a palindrome\n";
} qpo{^[jo}^[q is one way to do it: qp start recording and use register p o open a new line { insert { character ^[ go back to Normal mode (Esc key) j move down one line o open another line } insert } character ^[ go back to Normal mode (Esc key) q stop recording Having a macro will help you apply this correction whenever you forget braces for single statement control structures. info Note that { and } will be indented based on style settings for that particular filetype.
